function rand(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

// BackgroundStars
class BackgroundStars {
    #precalculatedStars;
    #diameter;
    #canvas;
    #context;
    #animationController;

    constructor(canvasId, precalculatedStars) {
        this.#precalculatedStars = precalculatedStars;
        this.#diameter = this.#calcDiameter();

        this.#canvas = document.getElementById(canvasId);
        this.#context = this.#canvas.getContext("2d");

        this.#init();
        window.addEventListener("resize", this.#init);
    }

    get controller() {
        return this.#animationController;
    }

    #calcDiameter() {
        const largestWindow = (window.innerWidth >= window.innerHeight)
            ? window.innerWidth : window.innerHeight;
        return (largestWindow * Math.sqrt(2)) * Math.sqrt(2);
    }
    
    #init() {
        // draw stars
        this.#canvas.width = this.#diameter;
        this.#canvas.height = this.#diameter;

        for (let i = 0; i < this.#precalculatedStars.length; i++) {
            this.#context.beginPath();
            this.#context.arc(this.#precalculatedStars[i].x, this.#precalculatedStars[i].y, this.#precalculatedStars[i].radius, 0, 360);
            this.#context.fillStyle = `hsla(${this.#precalculatedStars[i].hue}, ${this.#precalculatedStars[i].sat}%, 90%, 0.9)`;
            this.#context.fill();
        }

        // animation controller
        this.#animationController = anime({
            targets: this.#canvas,
            duration: 500000,
            loop: true,
            rotate: 360,
            autoplay: false,
            easing: 'linear',
        });
        
    }
}
